import { Link, useNavigate } from 'react-router-dom';

const Register = () => {
  const navigate = useNavigate();

  const handleSubmit = (e) => {
    e.preventDefault();
    localStorage.setItem('authToken', 'fake-jwt-token');
    navigate('/dashboard');
  };

  return (
    <div className="min-h-screen bg-gray-100 flex items-center justify-center">
      <div className="max-w-md w-full p-8 bg-white rounded-xl shadow-xl">
        <h2 className="text-3xl font-bold text-center mb-8">Create Account</h2>
        <form onSubmit={handleSubmit}>
          <input type="text" placeholder="Full Name" className="w-full px-4 py-3 mb-4 border rounded-full" required />
          <input type="email" placeholder="Email" className="w-full px-4 py-3 mb-4 border rounded-full" required />
          <input type="password" placeholder="Password" className="w-full px-4 py-3 mb-6 border rounded-full" required />
          <button type="submit" className="w-full bg-blue-600 text-white py-3 rounded-full font-bold hover:bg-blue-700">
            Sign Up
          </button>
        </form>
        <p className="mt-4 text-center">
          Already have an account? <Link to="/login" className="text-blue-600 font-bold">Login</Link>
        </p>
      </div>
    </div>
  );
};

export default Register;
